export const CheckBox = props => {
    var currentOptions = props.cd[props.c].options;
    var options = currentOptions.map((option) =>
      <div class="form-check">
        <input class="form-check-input" type="checkbox" value={option.value} checked={option.isChecked} onClick={props.handleCheck} id="defaultCheck1"></input>
        <label class="form-check-label" for="defaultCheck1">{option}</label>
      </div>
    );
    return (
      <div class="form-group">
        {options}
      </div>
    )
  }

export default CheckBox
